const express = require("express");
var cors = require("cors");
const app = express();

app.use(cors());

const posts = [
  {
    id: 1,
    title: "Post 1",
    shortDesc: "Lorem ipsum dolor sit amet, requiesqet in pacem",
    imgSrc:
      "data:image/jpeg;base64,",
  },
  {
    id: 2,
    title: "Post 2",
    shortDesc: "Lorem ipsum dolor sit amet, requiesqet in pacem",
    imgSrc:
      "data:image/jpeg;base64,",
  },
  {
    id: 3,
    title: "Post 3",
    shortDesc: "Lorem ipsum dolor sit amet, requiesqet in pacem",
    imgSrc:
      "data:image/jpeg;base64,",
  },
];

app.get("/", (req, res) => {
  res.send(posts);
});

app.post("/", (req, res) => {
  res.send({
    status: 201,
    data: "Se ha creado un nuevo post",
  });
});

app.put("/", (req, res) => {
  res.send({
    status: 201,
    data: "Se ha actualizado el post",
  });
});

app.delete("/", (req, res) => {
  res.send("Se ha eliminado el post");
});

app.get("/error", (req, res) => {
  throw new Error("Ha habido un problema");
});

app.listen(3000, () => {
  "Server listening in port 3000";
});
